import React, {useState} from 'react';
import {View, SafeAreaView, Text, StyleSheet, TextInput, FlatList, Image, ScrollView, TouchableOpacity, ImageBackground} from 'react-native';
import Icon2  from 'react-native-vector-icons/AntDesign';
import Icon  from 'react-native-vector-icons/Feather';
import styled from 'styled-components/native';
import {VectorHeader} from '../../components/screenComponents/components';



const GreyView= styled.View`
width: 48px;
height: 48px;
border-radius:50px;
background: #4E4E4E;
`;


const TopText= styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 700;
font-size: 18px;

color: #FFFFFF;
`;

const BottomText= styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 14px;

color: #FFFFFF;
`;

const GymCarosel= styled.Image`
width: 148px;
height: 116px;
border-radius: 5px;
margin:10px 20px 10px 0;
`;




export default function Food2({navigation}){
    const Carosel = [require('../../../assets/hotelpic5.png'), require('../../../assets/hotelpic6.png'), require('../../../assets/hotelpic1.png')]

	return(
	<SafeAreaView style={styles.container}>	
    <ScrollView>

        <VectorHeader
        goBack={()=>navigation.goBack()}
        handleBrandView={()=>handleBrandView()}
        handleCart={()=>handleCart()}/>

        <View style={styles.top}>
          <GreyView></GreyView>
          <View style={styles.text}>
            <TopText>Brand Name</TopText>
            <BottomText>0.7km away</BottomText>
          </View>
        </View>
        <ScrollView horizontal showsHorizontalScrollIndicator={false} style={{padding:20, paddingTop:10}}>
       {Carosel.map((item, index) => {
              return (
                
                <View key={index} contentContainertyle={styles.carosel}>
                
                    <GymCarosel source={item}/>
                </View>
              );
            })}
        </ScrollView>
    </ScrollView>
    </SafeAreaView>	

)}


const styles = StyleSheet.create({
  container:{
    flex:1,
    backgroundColor:'#000',
  },
  top:{
    flexDirection:'row'
  },
  text:{
  justifyContent:'center',
  margin:20
  },
  carosel:{
    flexDirection:'row', 
    alignItems:'center', 
  },

})
